const RightContent = (props) => {
    const {dataQuiz} = props;
    return (
       <>
       <div className="main-timer">
                10:10
       </div>
       <div className="main-question">
            {dataQuiz && dataQuiz.length > 0 }
                   
       </div>
       </>
    )
}

export default RightContent;
